import{_ as e,c as t,o as l,ab as a}from"./chunks/framework.CUflZczI.js";const u=JSON.parse('{"title":"Розробка PX4","description":"","frontmatter":{},"headers":[],"relativePath":"uk/development/development.md","filePath":"uk/development/development.md"}'),i={name:"uk/development/development.md"},r=a('<h1 id="розробка-px4" tabindex="-1">Розробка PX4 <a class="header-anchor" href="#розробка-px4" aria-label="Permalink to &quot;Розробка PX4&quot;">​</a></h1><p>Ця секція пояснює як почати підтримувати нові типи літальних апаратів та їх варіанти, модифікувати польотні алгоритми, додавати нові режими, інтегрувати нові пристрої, і комунікувати з польотним контролером PX4 ззовні.</p><p>Ця секція призначена для розробників програмного забезпечення і (нових) інтеграторів апаратного забезпечення. Вона не потрібна якщо Ви будуєте на існуючій рамі або літаєте використовуючи апарат на основі PX4. :::</p><p>Тут пояснюється, як:</p><ul><li>Отримати <a href="./../dev_setup/config_initial.html">мінімальний сетап розробника</a>, <a href="./../dev_setup/building_px4.html">зібрати PX4 із сорс коду</a> та задеплоїти на <a href="./../flight_controller/README.html">численні підтримувані плати автопілотів</a>.</li><li>Зрозуміти <a href="./../concept/architecture.html">архітектуру системи PX4</a> та інші ключові концепції.</li><li>Дізнатись як модифікувати польотний стек та мідлварь (проміжне ПЗ): <ul><li>Змінити алгоритми польоту і додати нові <a href="./../concept/flight_modes.html">режими польоту</a>.</li><li>Підтримувати нові <a href="./../dev_airframes/README.html">рами/планери</a>.</li></ul></li><li>Дізнатися, як інтегрувати PX4 з новим обладнанням: <ul><li>Підтримувати нові сенсори, актуатори, включаючи камері, далекоміри, тощо.</li><li>Модифікувати PX4 для роботи на новому залізі для автопілотів.</li></ul></li><li><a href="./../simulation/README.html">Моделювати</a>, <a href="./../test_and_ci/README.html">тестувати</a> and <a href="./../debug/README.html">відлагоджувати/збирати логи</a> PX4.</li><li>Комунікувати/інтегрувати з зовнішніми робототехнічними API.</li></ul><h2 id="ключові-посилання-для-розробника" tabindex="-1">Ключові посилання для розробника <a class="header-anchor" href="#ключові-посилання-для-розробника" aria-label="Permalink to &quot;Ключові посилання для розробника&quot;">​</a></h2><ul><li><a href="./../contribute/support.html">Підтримка</a>: отримуйте допомогу скориставшись <a href="https://discuss.px4.io//" target="_blank" rel="noreferrer">форумами для обговорень</a> та іншими каналами підтримки.</li><li><a href="./../contribute/dev_call.html">Щотижневий дзвінок розробникам</a>: чудова нагода зустрітися з командою розробників PX4 і обговорити технічні деталі платформи (зокрема запити на отримання, основні проблеми, загальні запитання та відповіді).</li><li><a href="./../contribute/licenses.html">Ліцензії</a>: що Ви можете робити з кодом (вільно використовувати та змінювати згідно з умовами дозвільної <a href="https://opensource.org/licenses/BSD-3-Clause" target="_blank" rel="noreferrer">3-пунктової ліцензії BSD</a>!)</li><li><a href="./../contribute/README.html">Допомога</a>: як працювати з нашим <a href="./../contribute/code.html">вихідним кодом</a>.</li></ul>',7),o=[r];function n(h,c,s,_,d,p){return l(),t("div",null,o)}const f=e(i,[["render",n]]);export{u as __pageData,f as default};
